import { Table, Tag } from "antd";
import axios from "axios";
import React, { useEffect, useState } from "react";

function Product() {
  const [product, setProduct] = useState([]);

  useEffect(() => {
    axios
      .get("/product?q=rose&limit=25&page=1")
      .then((response) => {
        if (response.status === 200) {
          setProduct(response.data);
        } else {
          console.log("Connect fail");
        }
      })
      .catch(function (error) {
        console.log(error);
      });

    return () => {};
  }, []);

  const conlumn = [
    {
      title: "Name",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "Brand",
      dataIndex: "brand",
      key: "brand",
    },
    {
      title: "Ingredient list",
      key: "tags",
      dataIndex: "ingredient_list",
      render: (tags) => (
        <>

            return (
              <div className="ingredient-list-table">
                {tag.toString()}
              </div>
            );

        </>
      ),
    },
    {
      title: "Quality",
      key: "quantity",
      dataIndex: "ingredient_list",
      render: (tags) => (
        <>
        {
          tags.length > 50 ? <Tag color="green">good</Tag> : <Tag color="geekblue">Normal</Tag>}</>
      ),
    },
  ];
  return (
    <div>
      <Table
        columns={conlumn}
        dataSource={product}
        className="table-product"
      ></Table>
    </div>
  );
}
export default Product;
